import '.'
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import './MapLeaflet.scss'
import React from "react";

export const MapLeaflet = () => {
    return (
        <div>
            <div>
                <MapContainer
                    center={{ lat: 55.8551159, lng: 37.4762037}}
                    zoom={15}
                    scrollWheelZoom={false}>

                    <TileLayer
                        attribution='&copy; <Navlink href="http://osm.org/copyright">OpenStreetMap</Navlink> contributors'
                        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    />
                    <Marker position={{ lat: 55.8551159, lng: 37.4762037}}>
                        <Popup>
                            сука <br /> блэт.
                        </Popup>
                    </Marker>
                </MapContainer>
            </div>
        </div>
    )
}

export default MapLeaflet;
